import React from "react";
import "./Footer.css";
import { Link } from "react-router-dom";
import logo from "../images/logo.png";

const Footer = () => {
  return (
    <div className="footer">
      <section className="social-media"> Social Media </section>

      <div className="footer-navigation">
        <section className="sitemap">
          <h3> Sitemap </h3>
        </section>

        <section className="footer-company-history">
          <h3> Company </h3>
          <div>
            <a href="index.html">Home</a>
            <a href="service.html">Services</a>
            <a href="research.html">Research</a>
            <a href="registrationForm.html">Registration Form</a>
      </div>
        </section>

        <section className="footer-contact">
          <h3> Contact </h3>
        </section>
      </div>

      <section className="footer-copyright">
        <p> &copy; 2022 LisaConsult. All rights reserved! </p>
        <div>
        <Link to="/"> <img src={logo} alt="Logo of LisaConsult" /> </Link>
        <p> LisaConsult </p>
        </div>
      </section>
    </div>
  );
};

export default Footer;
